(1, 1, 'ABOUT EWSI', '<p>Wall Street Elite International (EWSI) is one of the world&#39;s elite and has a well-known international companies working experience, familiar with Sino-US cultural, legal regulations and market operation mode elite.</p>\r\n\r\n<p>Meanwhile, EWSI train partners include experienced professional team of immigration lawyers, Real Estate law firms, international tax experts, accounting firms and other powerful backing, providing customers with professional caring service.</p>\r\n\r\n<p>EWSI uphold social commitment and dedication to businesses and individuals to build a dream come true the world stage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 0, ''),
