(2, 1, 'OUR TEAM', '<p>The Elite Wall Street International (EWSI) team members consist of the experienced advisors who have an global and international perspective as well as seasoned corporate experience.</p>\r\n\r\n<p>Our advisors are also familiar with the US as well as the Chinese culture, the various aspects of legality and different policies between the countries. For Chinese enterprises to expand on a global basis, and for US corporations desiring to enter the Chinese market, EWSI can help and assist entities from both sides of the Pacific ocean to enhance its operations and expansion.</p>\r\n\r\n<p>EWSI can also help and assist individuals desiring to study abroad to nurture and settle-in to the US culture. EWSI will be fully dedicated to provide services for corporations and individuals to make their desires and objectives come true.</p>\r\n', NULL, 0, ''),
