(4, 1, 'REAL ESTATE', '<p>As a professional&nbsp;team of&nbsp;New York Real Estate experts, we&nbsp;have adequate housing access&nbsp;and&nbsp;the US&nbsp;Real Estate expertise and experience. Our team&nbsp;is knowledgeable about&nbsp;the difference between&nbsp;American and Chinese culture, customs, regulations, taxes and transaction processes.&nbsp;Therefore, we are able to&nbsp;meet your&nbsp;investment objectives and process the entire transaction&nbsp;smoothly and efficiently. Our service including residential purchasing, commercial purchasing,&nbsp;short-term and long-term&nbsp;residential and commercial&nbsp;leasing, investment.</p>\r\n\r\n<p>For more information, please visit our Real Estate website &nbsp;<a href=\"http://http://yuehao.elliman.com/\">www.haofengshui888.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 0, ''),
