(5, 1, 'China Representative of New York Couture Fashion Week', '<p>New York Couture Fashion Week</p>\r\n\r\n<p>An exclusive event held twice a year presenting runway fashion shows by exceptional couture and luxury designers for an audience of upscale sonsumers, invited VIPs, the press and selected hgh-end store buyers. The multi-day event presents 4 to 12 different exquisite collections per day and also includes luxury product/service and fine art exhibits, recpetions and after parties, VIP dinners, and world-class entertainment.</p>\r\n\r\n<p>Services:</p>\r\n\r\n<p>Connect with the press, upscale consumers, corporate executives, professionals, VIPs, socialites, and fashionistas;</p>\r\n\r\n<p>On-site gifts and publicity materials distribution</p>\r\n\r\n<p>Share platform with fine designers from around the worldï¼›</p>\r\n\r\n<p>Photo shooting with models, celebrities and officialsï¼›</p>\r\n\r\n<p>Video interviews;</p>\r\n\r\n<p>Reach an affluent, trendsetting and fashion-conscious market segment via a one-of-a-kind branding and marketing platformï¼›</p>\r\n\r\n<p>Logo will be on the fashion show screens. All days of the eventï¼›</p>\r\n\r\n<p>Hold conference or seminar during the CFWï¼›</p>\r\n\r\n<p>Provide models, hair stylist, makeup and other runway services to desingerï¼›</p>\r\n\r\n<p>Spring:</p>\r\n\r\n<p>Feb.15,16,17 2013&nbsp;--- New Yorker Hotel</p>\r\n\r\n<p>Fall:</p>\r\n\r\n<p>Sep.5,6,7,8 2013&nbsp;--- The Waldorf Astoria New York Hotel</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 0, ''),
