(18, 1, 'Oversea Representative of Beijing Saier Outlets Commercial Plaza', '<p>Saier Outlets Commercial Plaza of Beijing</p>\r\n\r\n<p>The Beijing Saier Outlet Mall aims to build a platform for the internatonal and domestic top brands to develop and improve their brand name in China market. They&nbsp;are orient on high-end position and provide high quality services to the customers and partners. Beijing Saier Outlet Mall targeted partners including the most famous brands, globally and domestically. Combined with a misture of modern relaxation design, fine dining, recreation and shopping center, the Beijing Saier Outlet Mall is a new style of Outlet Mall in China.</p>\r\n\r\n<p>Along witht the constantly high speed development of economy in China, the Chinese consumers purchasing habits are being changed. With the rising consumption power, Chinese consumers are chasing for a higher quality of living. Chinese consumers have become main buyers of luxury goods worldwide. This means the conditions to develop the supply chains and base of Chinese consumpation power of Outlet Mall in China are ready. China has the capacity to become the leading market of Outlet Mall in the world.</p>\r\n\r\n<p>The Beijing Saier Outlet Mall is located at Huang Tu Gang (A famous nursey center in Beijing), Feng Tai District, Beijing City. The Mall can be reach and cover by the major public transport junction. It takes only 15 KM away from most of the Beijing&#39;s business districts, tourism districts, and Beijing Central Adminsitrative Districts. Both the great location and convinient transportaiton provide this project with the perfect business development opportuinites.</p>\r\n', NULL, 0, ''),
